import React, { useState } from "react";
// import { useParams } from "react-router-dom";
import axios from "axios";
import { Modal } from "react-bootstrap";
import Popup from "reactjs-popup";

function CreateSchema() {
  // const { did } = useParams();
  const [showModal, setShowModal] = useState(false);
  const [attributes, setAttributes] = useState({
    branchName: "",
    branchManager: "",
    address: "",
    longitude: "",
    latitude: "",
  });
  let onClose = () => {
    setShowModal(false);
  };
  const handleChange = (e) => {
    setAttributes(e.target.value);
  };

  function handleCreateSchema(e) {
    e.preventDefault();

    // axios
    //   .post("http://localhost:3007/create-invitation", {
    //     did: did,
    //     status: "pending",
    //   })
    //   .then((response) => {
    //     console.log(response.data);
    //   })
    //   .catch((error) => {
    //     console.error(error);
    //   });

    // // Clear fields and perform other necessary actions
    // setDid("");
    // onClose();
  }

  return (
    <div>
      <h2 style={{ padding: "20px" }}>
        Hello Issuer, in order to legitimize this branch you need to follow
        these steps:
      </h2>
      <ul>
        <li>
          <b>Step 1:</b> Click on <i>Create Schema</i> to create and send a form
          to the branch &nbsp;
          <button
            type="button"
            className="btn btn-light"
            data-toggle="modal"
            onClick={() => {
              setShowModal(true);
            }}
          >
            Create Schema
          </button>
          {showModal && (
            <Modal fullscreen="true" show={showModal} onHide={onClose} centered>
              <Popup
                trigger={
                  <div
                    id="exampleModal"
                    role="dialog"
                    aria-labelledby="exampleModalLabel"
                    aria-hidden="true"
                    aria-modal="true"
                  >
                    <div className="modal-dialog" role="document">
                      <div className="modal-content">
                        <div className="modal-header">
                          <h5 className="modal-title" id="exampleModalLabel">
                            Create a Schema to define criterias to be filled by branch
                          </h5>
                          <button
                            type="button"
                            className="close"
                            onClick={() => {
                              onClose();
                            }}
                            data-dismiss="modal"
                            aria-label="Close"
                          >
                            <span aria-hidden="true">&times;</span>
                          </button>
                        </div>
                        <div className="modal-body">
                          <form>
                            <div className="form-group">
                              <label
                                htmlFor="recipient-name"
                                className="col-form-label"
                              >
                               Attributes
                              </label>
                              <input
                                type="text"
                                className="form-control"
                                id="recipient-name"
                                name="holder-did"
                                onChange={handleChange}
                                value={attributes}
                              />
                            </div>
                          </form>
                        </div>
                        <div className="modal-footer">
                          <button
                            type="button"
                            className="btn btn-secondary"
                            data-dismiss="modal"
                            onClick={() => {
                              onClose();
                            }}
                          >
                            Close
                          </button>
                          <button
                            type="button"
                            className="btn btn-primary"
                            onClick={handleCreateSchema}
                          >
                            Send Invitation
                          </button>
                        </div>
                      </div>
                    </div>
                  </div>
                }
              ></Popup>
            </Modal>
          )}
        </li>
        <li>
          <b>Step 2:</b> Wait for the branch to fill in the form
        </li>
        <li>
          <b>Step 3:</b> generate and send a QR code for the Legitimized branch
        </li>
      </ul>
    </div>
  );
}

export default CreateSchema;
